import React from 'react';

import { useSelector} from 'react-redux';
import Prolist from './productlistitem';



function Cart() {
    const list = useSelector((state) => state.cart.product)

    return (
      <>
   {list.map((item) => <Prolist {...item}/>)}
   </>
      );
}

export default Cart;
